import React from 'react';
import './App.css';
import Header from './components/header';
import Certifications from './components/certifications';
import './app.scss';

function App() {
  return (
    <div className="App">
      <div className="Intro">
        <Header />
      </div>
      <br />
      <div className="Main">
        <Certifications />
      </div>
    </div>
  );
}

export default App;
